import React from "react";
import hoteltyle from "../../../data/hotel_list.json";
import Hoteltypes from "../hoteltype/hotelstypes.jsx";

const Hoteltype = () => {
  return (
    <div className="container">
      <h3>Homes guests love</h3>
      <div className="hotels">
        {hoteltyle.map((hotel) => (
          <Hoteltypes>
            key={hotel.name} item={hotel}
          </Hoteltypes>
        ))}
      </div>
    </div>
  );
};
export default Hoteltype;
